import React, { useEffect, useState } from "react";
import * as moment from "moment";
import "moment/locale/th";
import NavbarPage from "../components/navnew";
import Axios from "axios";
import { Link, useHistory, useParams } from "react-router-dom";
import Chatbot from "../components/chatbot";
import { Form, Col,  } from "react-bootstrap";
import "./findthief.css";

const Findthief = () => {
  const history = useHistory();

  let { uid } = useParams();

  const [show, Setshow] = useState();
  const [showDropdown, SetshowDropdown] = useState(true);

  const Hiddendropdown = () => {
    SetshowDropdown(false);
  };

  const ok = async () => {
    Setloading(true);
    if (sortvalue === "ใหม่ล่าสุด") {
      const getpost = await Axios.get(`http://localhost:7000/post/post`);
      Setshow(getpost.data.item);
      var getdata = getpost.data.item;
    } else if (sortvalue === "จำนวนเงินมากที่สุด") {
      const getpost = await Axios.get(
        `http://localhost:7000/post/post/sortmoney`
      );
      Setshow(getpost.data.item);
      var getdata = getpost.data.item;
    }
    Setloading(false);

    console.log(result);
    var item = [];

    getdata.filter((doc) => {
      if (checkfacebook) {
        Setshow();
        if (doc.social === "Facebook") {
          if (checkcloth) {
            Setshow();
            if (doc.productcategory === "เสื้อผ้า") {
              if (searchstart && searchend) {
                Setshow();
                if (doc.money >= searchstart) {
                  if (doc.money <= searchend) {
                    item.push(doc);
                    Setshow();
                  }
                }
              } else if (searchstart) {
                Setshow();
                if (doc.money >= searchstart) {
                  console.log(doc);
                  item.push(doc);
                  Setshow();
                }
              } else if (searchend) {
                Setshow();
                if (doc.money <= searchend) {
                  item.push(doc);
                  Setshow();
                }
              }
            }
          }
          if (checkassesory) {
            Setshow();

            if (doc.productcategory === "เครื่องประดับ") {
              if (searchstart && searchend) {
                Setshow();
                if (doc.money >= searchstart) {
                  if (doc.money <= searchend) {
                    item.push(doc);
                    Setshow();
                  }
                }
              } else if (searchstart) {
                Setshow();
                if (doc.money >= searchstart) {
                  console.log(doc);
                  item.push(doc);
                  Setshow();
                }
              } else if (searchend) {
                Setshow();
                if (doc.money <= searchend) {
                  item.push(doc);
                  Setshow();
                }
              }

              if (!searchstart && !searchend) {
                item.push(doc);
                Setshow();
              }
            }
          }
          if (checkshoe) {
            Setshow();
            if (doc.productcategory === "รองเท้า") {
              if (searchstart && searchend) {
                Setshow();
                if (doc.money >= searchstart) {
                  if (doc.money <= searchend) {
                    item.push(doc);
                    Setshow();
                  }
                }
              } else if (searchstart) {
                Setshow();
                if (doc.money >= searchstart) {
                  console.log(doc);
                  item.push(doc);
                  Setshow();
                }
              } else if (searchend) {
                Setshow();
                if (doc.money <= searchend) {
                  item.push(doc);
                  Setshow();
                }
              }

              if (!searchstart && !searchend) {
                item.push(doc);
                Setshow();
              }
            }
          }

          if (checkbag) {
            Setshow();
            if (doc.productcategory === "กระเป๋า") {
              if (searchstart && searchend) {
                Setshow();
                if (doc.money >= searchstart) {
                  if (doc.money <= searchend) {
                    item.push(doc);
                    Setshow();
                  }
                }
              } else if (searchstart) {
                Setshow();
                if (doc.money >= searchstart) {
                  console.log(doc);
                  item.push(doc);
                  Setshow();
                }
              } else if (searchend) {
                Setshow();
                if (doc.money <= searchend) {
                  item.push(doc);
                  Setshow();
                }
              }

              if (!searchstart && !searchend) {
                item.push(doc);
                Setshow();
              }
            }
          }
          if (checkphone) {
            Setshow();
            if (doc.productcategory === "มือถือและอุปกรณ์เสริม") {
              if (searchstart && searchend) {
                Setshow();
                if (doc.money >= searchstart) {
                  if (doc.money <= searchend) {
                    item.push(doc);
                    Setshow();
                  }
                }
              } else if (searchstart) {
                Setshow();
                if (doc.money >= searchstart) {
                  console.log(doc);
                  item.push(doc);
                  Setshow();
                }
              } else if (searchend) {
                Setshow();
                if (doc.money <= searchend) {
                  item.push(doc);
                  Setshow();
                }
